    children?: ReactNode,
    title: string
    // any props that come into the component
}
export const Window = ({ children, ...props }: Props) => {
  const open = () => {
    console.log('window opened');
  }

  const windowStyle = {
    backgroundColor: '#060B15',
    padding:"30px",
    paddingTop: "0",
    marginBottom: "5%",
    border: "1px solid white",
    borderRadius: "1%"
  };

  return (
      <>
    <Row style={{width:"100%", margin:"0", marginTop: "5px"}}>
        <Col>x</Col>
        <Col xs={12} md={10} style={{textAlign:"center"}}><p>{props.title}</p></Col>
        <Col><img src={enlargeIcon} style={{width:"20px"}}></img></Col>
    </Row>
    <div onClick={open} style={windowStyle}>

        {children}
    </div>
    </>
  );
};
